@Component({
  selector: 'app-footer',
  templateUrl: './footer.component.html',
  styleUrls: ['./footer.component.css']
})
export class FooterComponent {

}
<footer class="footer text-center bottom text-lg-start mt-auto py-3">
  <div class="text-center p-3">
    Made by Ronak Sajal
  </div>
</footer>
